import React from "react";
import lodging from "../../data/lodging.json"
import "../styles/tags.sass";


function Tags(props) {
    const { lodging } = props; // Assuming you receive the lodging array as a prop

    return (
      <ul className='Tags-element'>
        {lodging.map((lodging) => {
          const { tags } = lodging;

          return (
            <div className="lodgingElement" key={tags}>
              <li className="tags"> {tags} </li>

            </div>
          );
        })}
      </ul>
    );
  }

export default Tags;
